export default function App() {

  //redux hook
  const appReducer = useSelector(({appReducer}) => appReducer);

  return (
    <div style={{padding:10}}>
      <h1 /*onClick={()=>setCount(count+1)}*/ >Hello, Again : {appReducer.count}</h1>
      <Box1 />
      <Box2 />
      <Box3 />
    </div>
  );

}
